import React from 'react'
import { makeStyles,withStyles, Card, Avatar } from "@material-ui/core";
import SearchBar from "material-ui-search-bar";
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';

const useStyles = makeStyles({
    sideMenu:{
        display: 'flex',
        flexDirection: 'column',
        position: 'absolute',
        top : '75px',
        left : '0px',
        width : '235px',
        height : '100%',
        backgroundColor : 'rgb(217, 254, 255)'

    }
})

export default function SideMenu() {
    const classes = useStyles()

    return (
        <div className={classes.sideMenu}>
            <font style={{marginTop:'10px', marginLeft:'10px'}}>Patients</font>
            <SearchBar style={{width:'215px', height:'30px', margin:'10px'}} placeholder='Search Patient'/>

            <Card style={{margin:'10px', marginTop:'0px', padding:'10px', paddingBottom:'15px'}}>
            <Avatar alt="Remy Sharp" src="/images/a1.jpeg" style={{float:'left'}} />
                <center>
                <b>Shivam Sharma</b>
                <br style={{lineHeight:'5px'}} />

                <FiberManualRecordIcon style={{float:'right', height:'15px', marginRight:'-8px', fill:'#39FF14'}}></FiberManualRecordIcon>
                <font style={{fontSize:'10px'}}>9 Jan 2021</font> 
                
                
                </center>
            </Card>

            
        </div>
    )
}
